import React, { Component } from 'react'
import { InputGroup } from 'react-bootstrap';
import {Button, Form} from 'react-bootstrap/Button';

const Notifyme = (props)=>{
    return(
   <div className="notify">
       <InputGroup className="inputGrp">
            <FormControl
                placeholder="Reminde you?"
                aria-describedby="basic-addon2"
            />
      

            <InputGroup.Append className="Append">
                <Button variant= 'outline-secondary'>Notify Me!</Button>
            </InputGroup.Append>
        </InputGroup>
   </div>
    );
}

export default Notifyme
